using namespace std;


struct node{
private:
    node* next;
    char val;
public:
    explicit node(char c):val{c},next{nullptr}{};
    void setNext(node* nodePtr){
        next = nodePtr;
    }

    char getVal(){
        return val;
    }

    node* getNext(){
        return next;
    }
};
class Solution {

public:
    Solution() {};


    vector<pair<char, vector<int>>> buildDataSet(string s) {

        bool in_data_set = false;
        vector<pair<char, vector<int> > > letterIndicesS1;
        string remake1;

        for (int i = 0; i < s.length(); i++) {

            // check to see if the letter is in the string rebuilt.
            if (i == 0) {
                vector<int> indices;
                indices.push_back(i);
                letterIndicesS1.emplace_back(s[i], indices);
            } else {
                // check the rebuilt string to see if the letter is already there
                for_each(remake1.begin(), remake1.end(), [&](char each) mutable -> void {
                    if (s[i] == each) {
                        for_each(letterIndicesS1.begin(), letterIndicesS1.end(),
                                 [&](pair<char, vector<int>> &eachPair) mutable -> void {
                                     if (eachPair.first == each) {
                                         eachPair.second.push_back(i);

                                     }
                                 });
                        in_data_set = true;
                    }
                });

                if (!in_data_set) {
                    vector<int> indices;
                    indices.push_back(i);
                    letterIndicesS1.emplace_back(s[i], indices);
                }
            }

            remake1 += s[i];

        }

        return letterIndicesS1;
    }

    static bool compareDataSets(vector<pair<char, vector<int> > > d1, vector<pair<char, vector<int> > > d2) {
        bool isomorphic = true;
        for (int i = 0; i < d1.size(); i++) {

            if (d1[i].second.size() != d2[i].second.size()) {
                isomorphic = false;
                break;
            } else {
                for (int x = 0; x < d1[i].second.size(); x++) {
                    if (d1[i].second[x] != d2[i].second[x]) {
                        isomorphic = false;
                        break;
                    }
                }

            }
        }
        return isomorphic;
    }



    bool isIsomorphic(string s, string t) {

        bool isomorphic = true;

        vector<node*> linked_list;

        if (s.length() == t.length()) {

            for(int y = 0; y < s.length(); y++){
                node* first = new node(s[y]);
                node* second = new node(t[y]);

                first->setNext(second); // map the node.
                second->setNext(first);

                if(linked_list.empty()){
                    linked_list.push_back(first); // add the first item to the list.
                } else {
                    for(int i = 0; i < linked_list.size(); i++){

                        if(linked_list[i]->getVal() == first->getVal() || linked_list[i]->getNext()->getVal() == second->getVal()){// if it's found in the vector

                            if(linked_list[i]->getVal() == first->getVal()){
                                if(linked_list[i]->getNext()->getVal() != second->getVal()){
                                    cout << "FALSE" <<endl;

                                    isomorphic = false;
                                    break;
                                }
                            } else if(linked_list[i]->getNext()->getVal() == second->getVal()){
                                if(linked_list[i]->getVal() != second->getNext()->getVal()){
                                    cout << "FALSE" <<endl;
                                    isomorphic = false;
                                    break;
                                }
                            }
                        } else {
                            linked_list.push_back(first);
                        }

                    }
                }

            }
        }

        return isomorphic;
    }
};

